import React from 'react';
import { View, Text, Button } from 'react-native';

const HomeScreen = () => {
    return (
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
            <Text>HomeScreen</Text>
            <Button title="Log out" onPress/>
        </View>
    );
}

export default HomeScreen;
